					name: 'DomFlow-css',
					desc: '降级模式: item文本流排序的基础, 用户可自定义item的keyframes动画, 特点:1, 排序的效果没有过度; 2,不管是不是使用translate来定位, 用户自己都可以写keyframes, 因为translate是从0开始;'
				},
				'mode2': {
					attr: {
